function App() {
  return (
    <div className="App">
      <Container size="1">
      <Table.Root>
        <Table.Header>
          <Table.ColumnHeaderCell>Name</Table.ColumnHeaderCell>
          <Table.ColumnHeaderCell>Name</Table.ColumnHeaderCell>
          <Table.ColumnHeaderCell>Name</Table.ColumnHeaderCell>
          {/* Find empty header component */}
          <Table.ColumnHeaderCell></Table.ColumnHeaderCell>
        </Table.Header>
        </Table.Root>
      </Container>
